query SearchForArtist($query: String!) {
  search {
    artists(query: $query) {
      nodes {
        id: mbid
        name
        area {
          name
          __typename
        }
        lifeSpan {
          begin
          end
          ended
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

