query ArtistLookup($artistId: MBID!) {
  lookup {
    artist(mbid: $artistId) {
      name
      releaseGroups(type: ALBUM) {
        nodes {
          title
          firstReleaseDate
          coverArtArchive {
            hasArtwork: artwork
            images {
              image
              thumbnails {
                small
                large
                __typename
              }
              front
              back
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

